import React from 'react'

function TableBody({name, phoneNumber, email, feedback, rating}) {
    return (
        <tr>
            <td>{name}</td>
            <td>{phoneNumber}</td>
            <td>{email}</td>
            <td>{feedback}</td>
            <td>{rating}</td>
        </tr>
    )
}

export default TableBody
